  return (
    <React.Fragment>
      <form name="fib">
        <input type="number" min="1" max="100" placeholder="1" />{" "}
        <Button>get</Button>
      </form>
      <div>there will be your num</div>
      <Link to="/history"> history </Link>
    </React.Fragment>
  );
}

export default GetFibNum;
